<h2>paisnet table</h2>

<h3>Description</h3>

<p>paisnet table, based on PAISNET.DBF file from CNES TabWIN definitions file.
</p>


<h3>Usage</h3>

<pre><code class="language-R">paisnet
</code></pre>


<h3>Format</h3>

<p>A data frame with 266 rows and 3 variables:
</p>

<dl>
<dt>ID_PAIS</dt>
<dd>
<p>Country code 1</p>
</dd>
<dt>COPAISINF</dt>
<dd>
<p>Contry code 2</p>
</dd>
<dt>NM_PAIS</dt>
<dd>
<p>Label</p>
</dd>
</dl>
</div>
